-- ----------------------------
-- Procedure structure for DeleteData
-- ----------------------------
DROP PROCEDURE IF EXISTS `DeleteData`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `DeleteData`()
BEGIN
DELETE FROM abpauditlogs WHERE TO_DAYS(NOW())-TO_DAYS(ExecutionTime)>= 1;
DELETE FROM commaudiofilenames WHERE TO_DAYS(NOW())-TO_DAYS(CreationTime)>=2;
DELETE FROM playaudiologs WHERE TO_DAYS(NOW())-TO_DAYS(CreationTime)>=2;
DELETE FROM airshowdatas WHERE TO_DAYS(NOW())-TO_DAYS(ReciveTime)>=2;
DELETE FROM receivejsons WHERE TO_DAYS(NOW())-TO_DAYS(ReciveTime)>=2;
    END
;;
DELIMITER ;

-- ----------------------------
-- Event structure for e_delete_xhtime
-- ----------------------------
DROP EVENT IF EXISTS `e_delete_xhtime`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` EVENT `e_delete_xhtime` ON SCHEDULE EVERY 1 DAY STARTS '2019-09-01 20:17:00' ON COMPLETION NOT PRESERVE ENABLE DO CALL DeleteData()
;;
DELIMITER ;
